var b="url",c="垛区管理.html",d="generationDate",e=new Date(1682240950882.35),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="page",s="packageId",t="13850b8f69ff474e89f74ee31613d580",u="type",v="Axure:Page",w="垛区管理",x="notes",y="页面概述",z="<p><span>需求说明：</span></p><p><span>一、垛区列表：</span></p><p><span>1. 列表页展示库管创建的垛位；</span></p><p><span>2. 垛位根据创建时间正序排列；</span></p><p><span><br></span></p><p><span>二、垛区详情：</span></p><p><span>1. 名称：垛区类型 + 垛区名称；</span></p><p><span>2. 考核指标范围：</span></p><p><span>&nbsp;a. 信息项：展示指标项缩写+应用基缩写；</span></p><p><span>&nbsp;b. 范围信息：指标下边界~指标上边界</span></p><p><span>&nbsp; - 当仅录入下边界，展示≥；</span></p><p><span>&nbsp;- 当仅录入上边界，展示＜；</span></p><p><span>3. 垛格数：垛区内关联垛格的数量；</span></p><p><span><br></span></p><p><span>三、垛区操作：</span></p><p><span>1. 清垛：将垛区内的</span><span style=\"color:#D9001B;\">数质量清零</span><span>，</span><span style=\"color:#D9001B;\">垛格释放</span><span>；并创建仓库报损/报溢单；</span></p><p><span>a. 损溢重量：</span></p><p><span>&nbsp;- 当系统库存为正库存，则触发创建报损单，报损重量为实际库存绝对值；</span></p><p><span>- 当系统库存为负库存，则触发创建报溢单， 报溢重量为实际库存绝对值；</span></p><p><span>b. 清垛判断：</span></p><p><span>&nbsp;- 判断垛区内是否存在未完成的出/入/移垛事件。当存在，不可清垛；</span></p><p><span>（提示：垛区存在未完成的出/入/移垛记录。请完成后重试；）</span></p><p><span>c. 清垛二次确认：如原型</span></p><p><span><br></span></p><p><span>2. 编辑垛区：可任意编辑；</span></p><p><span>3. 设置垛格：可任意设置；</span></p><p><span>&nbsp;a. 垛格设置场景：选定垛区，操作增减垛格；</span></p>",A="annotations",B="style",C="baseStyle",D="627587b6038d43cca051c114ac41ad32",E="pageAlignment",F="center",G="fill",H="fillType",I="solid",J="color",K=0xFFFFFFFF,L="image",M="imageAlignment",N="near",O="imageRepeat",P="auto",Q="favicon",R="sketchFactor",S="0",T="colorStyle",U="appliedColor",V="fontName",W="Applied Font",X="borderWidth",Y="borderVisibility",Z="borderFill",ba=0xFF797979,bb="cornerRadius",bc="cornerVisibility",bd="outerShadow",be="on",bf=false,bg="offsetX",bh=5,bi="offsetY",bj="blurRadius",bk="r",bl=0,bm="g",bn="b",bo="a",bp=0.34901